	(31, 18, 'Property_-_Location_Confusion', 3, 'This relation might be confusing, either location or property, but it is more location than property.'),
	(32, 156, 'Destination_-_Location_Confusion', 1, 'This role might be patient of the turning event, other minds would see it (Location) of the turn, or (Destination) of it.'),
	(33, 46, 'Destination_-_Location_Confusion', 2, 'From my personal view, this role might be Destination or location, other minds would prefer one of them, user is free in such ambiguous cases.'),
	(34, 859, 'Time_-_Location_Confusion', 1, 'This could be time or location. Both are correct based on the user understanding.'),
	(35, 861, 'Time_-_Location_Confusion', 1, 'This could be time or location. Both are correct based on the user understanding.'),
	(36, 5591, 'Material_-_Property_Confusion', 1, 'This role could be material or property according to the understanding, both might be correct.'),
	(37, 221, 'Attribute_-_Location_Confusion_with_to_be_verb', 1, ''),
